import React from "react";
import { Link } from 'react-router-dom';
import {data} from './data';





export const Users = () =>{


    const imie = 'adi'

    return(

        <div>
            {
            data.map((user:any) =>
                <Link imie={imie} key={user.name} {...Users} to={`/users/${user.name}`}>{user.name}</Link>
            )}




        </div>
    )
}
